
/**
 * Module dependencies.
 */

var express = require('express');


var app = module.exports = express.createServer();




// Configuration

app.configure(function(){
  app.set('views', __dirname + '/views');
  app.set('view engine', 'jade');
  app.use(express.bodyParser());
  app.use(express.methodOverride());
  app.use(app.router);
  app.use(express.static(__dirname + '/public'));
});

app.configure('development', function(){
  app.use(express.errorHandler({ dumpExceptions: true, showStack: true })); 
});

app.configure('production', function(){
  app.use(express.errorHandler()); 
});

// Routes

app.get('/', function(req, res){
  res.render('index', {
    title: 'Express'
  });
});


var App = function(){};
App.prototype = {

	rateTalk: function(talk, userId, timestamp, ratingArray) {

		var r = new Resolver();
		var seconds = r.resolveTimestamp(timestamp, talk.start);

		this.updateRating(talk.id, userId, seconds, ratingArray);
	},


	updateRating: function(id, userId, secondsSinceStart, ratingArray) {
		var halfSeconds = secondsSinceStart * 2;
		var aggregate = 0;
		for (var i = 0; i < ratingArray.length; i++) {
			data.live_rating[id][userId][halfSeconds+i] += ratingArray[i];
			data.live_rating[id]['aggregate'][halfSeconds+i] += ratingArray[i];
			aggregate += ratingArray[i];
		}
		
		data.live_rating[id].aggregate += aggregate;
	},

};


app.get('/talk/:id/rate', function(req, res){
	
	var id = "dv1";
	var userId = 'shoez';
	var rating = [0.3, 0.4, 0.4, 0.5, 0.2, 0.2, 0.1, -0.1, -0.2, -0.2, -0.2];
	var mock_timestamp = '2011-09-30 23:20:00';

	var mocked_req = { id: id, user: userId, rating: rating, timestamp: mock_timestamp };
	
	data.to_process.push(mocked_req);
  	res.send('live rate talk');
});


app.post('/talk/:id/rate', function(req, res){
	
	var id = "dv1";
	var userId = 'shoez';
	var rating = [0.3, 0.4, 0.4, 0.5, 0.2, 0.2, 0.1, -0.1, -0.2, -0.2, -0.2];
	var mock_timestamp = '2011-09-30 09:40:00';

	var mocked_req = { id: id, user: userId, rating: rating, timestamp: mock_timestamp };
	
	to_process.push(mocked_req);
  	res.send('live rate talk');
});



app.listen(3000);
console.log("Express server listening on port %d in %s mode", app.address().port, app.settings.env);











