Resolver.prototype = {
	/* returns seconds since the session started */
	resolveTimestamp: function(timestamp, startTime) {
		var s = parseInt((Date.parse(startTime)) / 1000);
		var c = parseInt((Date.parse(timestamp)) / 1000);
		return c-s;
	},
};



